"use strict";AOS.init(),AOS.init({disable:!1,startEvent:"DOMContentLoaded",initClassName:"aos-init",animatedClassName:"aos-animate",useClassNames:!1,disableMutationObserver:!1,debounceDelay:50,throttleDelay:99,offset:120,delay:0,duration:400,easing:"ease",once:!0,mirror:!1,anchorPlacement:"top-bottom"});const burger=()=>{const e=document.querySelector(".burger"),t=document.querySelector(".header"),s=document.querySelector(".nav"),o=document.querySelector(".control");e.addEventListener("click",()=>{e.classList.toggle("active"),t.classList.toggle("active"),s.classList.toggle("active"),o.classList.toggle("active"),document.body.classList.toggle("no-scroll")}),window.addEventListener("resize",()=>{window.screen.width>768&&(e.classList.remove("active"),t.classList.remove("active"),s.classList.remove("active"),o.classList.remove("active"),document.body.classList.remove("no-scroll"))});document.querySelectorAll(".nav__link").forEach(a=>{a.addEventListener("click",()=>{e.classList.remove("active"),t.classList.remove("active"),s.classList.remove("active"),o.classList.remove("active"),document.body.classList.remove("no-scroll")})})};burger();const navScroll=()=>{const e=document.querySelectorAll(".nav__link");e.forEach(t=>{t.addEventListener("click",s=>{s.preventDefault(),e.forEach(e=>{e.classList.remove("active")}),t.classList.add("active");const o=t.getAttribute("data-target");if(o){let e=document.querySelector(""+o).offsetTop-70;window.scrollTo({top:""+e,behavior:"smooth"})}})})};navScroll();